function create_Editor(id,mode){var editor=ace.edit(id);switch(mode){case 1:editor.getSession().setMode("ace/mode/html");break;case 2:editor.getSession().setMode("ace/mode/jade")}editor.setReadOnly(!0)}function createACE(id){create_Editor(id+"_html",1),create_Editor(id+"_jade",2)}createACE("carousel"),createACE("accordion"),createACE("tabs"),createACE("modal"),createACE("panel");